import Profile from '../Profile/Profile.js';
import lImg from '../Images/lion.jpg';
import zImg from '../Images/zebra.jpg'
import cImg from '../Images/cat.jpg';
import eImg from '../Images/elephant.jpg'
import "./app.css";

export default function App() {
  function alertName(name,sound) {
    alert(`Hello I'm a ${name} \n and I ${sound}`);
  }
  return (
    <div className="App">
      <Profile
        fullName="Lion"
        bio="The lion (Panthera leo) is a large cat of the genus Panthera native to Africa and India. It has a muscular, broad-chested body, short, rounded head, round ears, and a hairy tuft at the end of its tail. It is sexually dimorphic; adult male lions are larger than females and have a prominent mane. It is a social species, forming groups called prides. A lion's pride consists of a few adult males, related females, and cubs. Groups of female lions usually hunt together, preying mostly on large ungulates. The lion is an apex and keystone predator; although some lions scavenge when opportunities occur and have been known to hunt humans, the species typically does not actively seek out and prey on humans."
        nickName="The king of the jungle"
        sound="Roar"
        imge={lImg}
        alertName={alertName}
      />
      <Profile
        fullName="Zebra"
        bio="Zebras are African equines with distinctive black-and-white striped coats. There are three living species: the GrÃ©vy's zebra (Equus grevyi), plains zebra (E. quagga), and the mountain zebra (E. zebra). Zebras share the genus Equus with horses and asses, the three groups being the only living members of the family Equidae. Zebra stripes come in different patterns, unique to each individual. Several theories have been proposed for the function of these stripes, with most evidence supporting them as a deterrent for biting flies. Zebras inhabit eastern and southern Africa and can be found in a variety of habitats such as savannahs, grasslands, woodlands, shrublands, and mountainous areas."
        nickName="ZigZaggy barcoded Mr. Zed"
        sound="Bray"
        imge={zImg}
        alertName={alertName}
      />
      <Profile
        fullName="Cat"
        bio="The cat (Felis catus) is a domestic species of small carnivorous mammal. It is the only domesticated species in the family Felidae and is commonly referred to as the domestic cat or house cat to distinguish it from the wild members of the family. A cat can either be a house cat, a farm cat, or a feral cat; the latter ranges freely and avoids human contact. Domestic cats are valued by humans for companionship and their ability to kill rodents. About 60 cat breeds are recognized by various cat registries."
        nickName="The king of you house"
        sound="Meow"
        imge={cImg}
        alertName={alertName}
      />
      <Profile
        fullName="Elephant"
        bio="Elephants are the largest existing land animals. Three living species are currently recognised: the African bush elephant, the African forest elephant, and the Asian elephant. They are the only surviving members of the family Elephantidae and the order Proboscidea. The order was formerly much more diverse during the Pleistocene, but most species became extinct during the Late Pleistocene epoch. Distinctive features of elephants include a long proboscis called a trunk, tusks, large ear flaps, pillar-like legs, and tough but sensitive skin. The trunk is used for breathing, bringing food and water to the mouth, and grasping objects. Tusks, which are derived from the incisor teeth, serve both as weapons and as tools for moving objects and digging. The large ear flaps assist in maintaining a constant body temperature as well as in communication. African elephants have larger ears and concave backs, whereas Asian elephants have smaller ears, and convex or level backs."
        nickName="Goliath"
        sound="Trumpet"
        imge={eImg}
        alertName={alertName}
      />
    </div>
    );
}
